import React, { Component } from 'react';
import axios from 'axios';

const keys = require('../../config/keys');

class YouTubeData extends Component {
  constructor(props) {
    super(props);

    this.state = { data: [] }
  }


  FetchData = async() => {
    alert("you got here");

    // GET YT Analytics API
    axios
      .get(keys.YOUTUBE_ANALYTICS_URI, {
        googleId: this.props.user.userID,
        token: this.props.accessToken,
        scope: keys.YOUTUBE_SCOPE,
        ids: this.state.channelName,
        startDate: '2017-01-01',
        endDate: '2017-12-31',
        metrics: 'estimatedMinutesWatched,views,likes,subscribersGained',
        dimensions: 'hour',
        sort: 'day'
      })
      .then(response => {
        // Handle success.
        console.log('Well done!');
        console.log(response);
      })
      .catch(error => {
        // Handle error.
        console.log('An error occurred:', error);
      });

  }

  render() {

    if (this.props.user === undefined) {
      var Content = "";
    } else {
      var Content = <button onClick={this.FetchData}>Fetch Data</button>;
    }

    return(
      <div className="Data">
        {Content}
      </div>
    );
  }
}

export default YouTubeData;
